import React from 'react';
 
class Home extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div class="tab-pane fade show active" id="home" role="tabpanel" aria-labelledby="home-tab">
                <h1>Welcome Ali's personal website</h1>
            </div>
        )
    }
    
}
 
export default Home;
